import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Event from './Event';
import App from './App';
import Location from './Location';
import Navigation from './Navigation';
import Body from './Body';
import Login from './Login';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
        <Navigation/>
        <Event name="Anuv" price="650" date="20/12/2023" Location="Jaipur" photo_icon="public/images/artist/cunn.png"/>
<Event name="King" price="1300" date="09/12/2023" Location="Delhi"/>
<Event name="Justin biber" price="1450" date="09/11/2023" Location="Goa"/>
<Event name="Weekend" price="5000" date="31/12/2023" Location="Mumbai" />
<Event name="Coldplay" price="10000" date="20/12/2023" Location="Jaipur" photo_icon="cunn.png"/>
<Event name="Ed SheerAn" price="950" date="20/12/2023" Location="Jaipur" photo_icon="cunn.png"/>
      </React.StrictMode>
);
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
